export default function fragmentShader() {
  return `
    uniform float time;
    uniform float progress;
    uniform sampler2D texture1;
    uniform vec4 resolution;
    varying vec2 vUv;
    varying vec3 vposition;
    float PI = 3.141592653589793238;
    void main() {
        vec4 t = texture2D(texture1, vUv);
        gl_FragColor = t;
    }
  `
}
